import React from 'react';
import pic from '../../rrrrrrr.jpg'

const Information = () => {
    return (
        <div>
             <div className='profile-owner'>
                <img className='profile-pic' src={pic} alt="" />
                <div>
                    <h5>Name: Rafin Hossain</h5>
                    <p>Dhamrai,Dhaka</p>
                </div>
           </div>
            
        </div>
    );
};

export default Information;
